import React from 'react';

import './Back.css';

const Back = () => (
  <div className="card">
    <div className="card__mark">
      <span dangerouslySetInnerHTML={ { __html: 'card' } } />
    </div>

    <div className="card__points">
      <span dangerouslySetInnerHTML={ { __html: 'card' } } />
    </div>

    <div className="card__mark-upside-down">
      <span dangerouslySetInnerHTML={ { __html: 'card' } } />
    </div>
  </div>
);

export default Back;
